import com.sap.gateway.ip.core.customdev.util.Message
import java.util.HashMap
import java.text.SimpleDateFormat

def Message processData(Message message) {
    
def staticContent = ""

    //Parse static content
    staticContent = new String(staticContent.decodeBase64(), "UTF-16LE")
    def baseUrl = "${message.getHeaders().get('CamelHttpUrl').replace('/main','')}".toString()
    //Replace endpoints with dynamic ones
    staticContent=staticContent.replace("{{SCPI_Dev_Tools}}", baseUrl)
	staticContent=staticContent.replace("{{SAP_ADMIN_MAPPING_TITLE}}", "SAP CPI - SBX - Developer Tools")

    //Set output
    message.setBody(staticContent.getBytes("UTF-8"));
    message.setHeader("Content-Type", "text/html; charset=utf-8");
    return message
}